"use strict";

const countKDifference = (nums, k) => {
    let ans = 0;
    const counter = new Map();
    for (const num of nums) {
        ans += (counter.get(num - k) || 0) + (counter.get(num + k) || 0);
        counter.set(num, (counter.get(num) || 0) + 1);
    }
    return ans;
};
